import React, {Component} from 'react'

class Results extends Component{

    centerBuilding = (args) => {
        console.log(args)
    }


    render(){

        if(this.props.response){
            console.log(this.props.response.items)

        }

        return(
            <div className="Results">
                {this.props.response && <div className="Result_List">
                <ul>
                {this.props.response.items.map(building => <li key={Math.random() * Math.random()} onClick={() => this.centerBuilding(building.snippet.title)}></li>)}
                </ul>
                </div>}
            </div>
        )
    }

}

export default Results
